import { classes } from "istanbul-lib-coverage";
import React from "react";
import styles from "../Header/Header.module.css";

const Header = (props) => {
  return (
    <header className={styles.header}>
      <div>
        <h1>React Meals</h1>
      </div>
      <div className={styles.cart}>
        <p>Your Cart</p>
      </div>
    </header>
  );
};

export default Header;
